INSERT INTO `adminnotification_inbox` VALUES ('1',1,'2016-03-30 18:24:35','Magento Community Edition 2.0.3 Includes Functional and Security Updates – 3/30/2016','Magento Community Edition 2.0.3 is now available and contains important security updates, as well as performance improvements and functional enhancements. Full details on the functional enhancements are included in the release notes at http://devdocs.magento.com/guides/v2.0/release-notes/ReleaseNotes2.0.3CE.html. More information on the security updates can be found on the Magento Security Center at https://magento.com/security/patches/magento-203-security-update.','https://magento.com/security/patches/magento-203-security-update',1,0),('2',1,'2016-04-01 00:40:23','New Release: Magento Community Edition 2.0.4 – 3/31/2016','We have released Magento Community Edition 2.0.4 to address a packaging issue with yesterday’s release. If you have already installed Enterprise Edition 2.0.3, you must replace it with the new version to ensure that your site receives all security enhancements. Learn more at https://magento.com/security/patches/magento-204-security-update','https://magento.com/security/patches/magento-204-security-update',1,0),('3',1,'2016-05-18 13:43:59','Community Edition 2.0.6 Provides Important Security and Functional Updates – 5/18/2016','Magento Community Edition 2.0.6 is now available and contains important security and functional improvements. More information on the security updates can be found on the Magento Security Center at https://magento.com/security/patches/magento-206-security-update. More information on the functional enhancements is provided in the release notes: http://devdocs.magento.com/guides/v2.0/release-notes/ReleaseNotes2.0.6CE.html','https://magento.com/security/patches/magento-206-security-update',1,0),('4',4,'2016-05-22 15:41:58','Repo.magento.com is currently unavailable. We are working to resolve this issue as quickly as possible – 5/22/16, 11:40 am PT','Users currently cannot access Magento 2 code updates from Repo.magento.com. We are investigating the issue and will update you when it is resolved. As an alternative, you can still access Magento 2 code from GitHub (https://github.com/magento/magento2) or from the Community Edition download page (https://www.magentocommerce.com/download). ','https://github.com/magento/magento2',1,0),('5',4,'2016-05-22 20:12:08','Issue with repo.magento.com has been resolved - 5/22/16, 4 pm PT','The issue with repo.magento.com has been resolved. You should be able to access Magento 2 code updates at this time.','http://devdocs.magento.com/guides/v2.0/install-gde/prereq/integrator_install.html',1,0),('6',4,'2016-05-24 11:08:30','New release: Magento Community Edition 2.0.7 Resolves Payment Gateway Issues – 5/24/16 ','Magento Community Edition 2.0.7 is now available. It resolves payment gateway issues experienced when using PHP 7.0.3. Review the release notes for more information: http://devdocs.magento.com/guides/v2.0/release-notes/ReleaseNotes2.0.7CE.html.','http://devdocs.magento.com/guides/v2.0/release-notes/ReleaseNotes2.0.7CE.html',1,0),('7',4,'2016-06-06 18:44:09','New Community Edition 2.0.7 Patch (MDVA-449) for Merchants Using PHP 5.5.x – June 6, 2016 ','A new patch, MDVA-449, enables merchants using Community Edition 2.0.7 and PHP 5.5.x to upgrade to future releases. It corrects a line of code in the Setup application that is packaged with Community Edition 2.0.7 that is not compatible with PHP 5.5.x. Merchants using Community Edition 2.0.7 with PHP 5.6.x and 7.0.x DO NOT need this patch. Learn more at http://devdocs.magento.com/guides/v2.0/release-notes/tech_bull_207-upgrade.html ','http://devdocs.magento.com/guides/v2.0/release-notes/tech_bull_207-upgrade.html ',1,0),('8',4,'2016-06-22 19:29:31','New Community Edition 2.0.x Patch (MDVA-532) Enables Upgrades to Magento 2.1 – June 22, 2016','A new patch, MDVA-532, enables merchants using Magento Community Edition 2.0.x to upgrade to Magento 2.1 Community Edition Release Candidates or GA software. More information about the patch and important instructions for command-line upgrades to Magento 2.1 when sample data is installed are available in a technical bulletin posted at http://devdocs.magento.com/guides/v2.0/release-notes/tech_bull_21-upgrade.html.','http://devdocs.magento.com/guides/v2.0/release-notes/tech_bull_21-upgrade.html',1,0),('9',4,'2016-06-23 13:44:46','Increase your sales and productivity, while simplifying PCI compliance with exciting new Magento Community Edition 2.1 features.','Shoppers can now check out faster using credit cards stored with PayPal and a redesigned PayPal checkout. PCI compliance is easier thanks to Braintree Hosted Fields. Admin tools are redesigned to help you work more efficiently. Upgrade to Enterprise Edition for new Content Staging and Preview and Enhanced Site Search capabilities.','https://magento.com/blog/magento-news/magento-enterprise-edition-21-unleashes-power-marketers-and-merchandisers ',1,0),('10',1,'2017-01-14 02:33:07','New Zend Framework Security Vulnerability – 1/13/2017','We’ve found a new vulnerability in a Zend Framework 1 and 2 email component used by all Magento 1 and Magento 2 software (as well as other PHP solutions). This vulnerability is serious and can lead to a remote code execution attack if your servers use Sendmail as a mail transport agent. Learn how to protect your sites at https://magento.com/security/news/new-zend-framework-1-security-vulnerability\n\n','https://magento.com/security/news/new-zend-framework-1-security-vulnerability',0,0),('11',4,'2017-01-19 16:59:15','New Magento DevBox Beta Speeds Magento 2 Setup – 1/19/2017','Magento DevBox Beta makes it faster and easier than ever to setup your Magento 2 development environment. Read our blog post to find out more at: https://magento.com/blog/technical/set-your-magento-2-development-environment-faster.','https://magento.com/blog/technical/set-your-magento-2-development-environment-faster',0,0);
