INSERT INTO `catalog_product_flat_1` VALUES ('1',4,'simple',NULL,'2016-05-04 12:47:47','<p>Pizza is a lifesaver, spirits-lifter, joy-bringer and quite a devoted friend.  If you don’t feel like eating out, you may order pizza and enjoy it at home. We have the biggest variety of pizza. Either you are up to having a traditional pizza, chicken and prawn pizza or a value or an extra value pizza, or maybe a gluten free pizza or a pizza from our chef - you’ll find all of them in this online store.</p>\r\n<p>We’ve simplified the ordering process as much as possible. Right now you can order a pizza via the website, via your smartphone app, via phone or using a live chat. If your order exceeds 10 items, we have a great discount for you! We’ll deliver you a steaming pizza within 30 minutes, or you may pick it up yourself when it’s ready. Find the store nearby and check out for yourself.</p> \r\n<p>So what types of pizza is available at our store? </p>',NULL,0,'/b/a/barbeky_deluxe.png',NULL,NULL,NULL,NULL,NULL,NULL,'Barbeky deluxe',NULL,NULL,'23.0000',NULL,NULL,0,'Pizza is one of those things which bring joy to both sides - to those who consume it and those who cook it. ',NULL,NULL,'Barbeky deluxe',NULL,'/b/a/barbeky_deluxe.png',NULL,NULL,NULL,NULL,'/b/a/barbeky_deluxe.png','2','/b/a/barbeky_deluxe.png',NULL,'2016-05-21 09:48:20','barbeky-deluxe',NULL,4,'1.0000',NULL),('2',4,'simple',NULL,'2016-05-04 12:57:10','<p>Pizza is a lifesaver, spirits-lifter, joy-bringer and quite a devoted friend.  If you don’t feel like eating out, you may order pizza and enjoy it at home. We have the biggest variety of pizza. Either you are up to having a traditional pizza, chicken and prawn pizza or a value or an extra value pizza, or maybe a gluten free pizza or a pizza from our chef - you’ll find all of them in this online store.</p>\r\n<p>We’ve simplified the ordering process as much as possible. Right now you can order a pizza via the website, via your smartphone app, via phone or using a live 