wishlist/\'}}\">Mi lista de deseos</a></li>\r\n   			<li><a href=\"#\">Estado de mi pedido</a></li>\r\n  			<li><a href=\"#\">Ayuda</a></li>\r\n	   	 </ul>\r\n    </div>\r\n</div>\r\n','2016-03-12 17:36:47','2016-03-21 15:10:41',1),(10,'Banner 1','banner-block-1','<div class=\"banner-container-1\">\r\n	<div class=\"container\">\r\n		<div class=\"row\">\r\n			<div class=\"col-md-6 banner-container-1__left-block\">\r\n				<span class=\"top-image\"><img src=\"{{view url=\'images/media/title-img.png\'}}\" alt=\"\"></span>\r\n				<h5 class=\"banner-slogan\">Hot deal of this spring!</h5>\r\n				<h3 class=\"banner-title\">BBQ Chicken Pizza</h3>\r\n				<p class=\"banner-description\">Tangy BBQ sauce is topped with mozzarella cheese, tender chicken, sweet red onions and fresh cilantro. Our dough is made fresh daily with enriched flour, followed by our thick, rich pizza sauce mixed with our own special herbs and spices.</p>\r\n				<a href=\"{{config path=\" web/unsecure/base_url\"}}pizza-bavarian.html\" class=\"banner-button\">Shop now</a>\r\n			</div>\r\n			<div class=\"col-md-6 banner-container-1__right-block\">\r\n				<img src=\"{{view url=\'images/media/banner-1_img.jpg\'}}\" alt=\"\">\r\n			</div>\r\n		</div>\r\n	</div>\r\n</div>','2017-01-12 15:04:57','2017-01-30 09:02:11',1),(11,'Banner 2','banner-block-2','<div class=\"banner-container-2\">\r\n	<span class=\"top-image\"><img src=\"{{view url=\'images/media/title-img.png\'}}\" alt=\"\"></span>\r\n	<h2 class=\"banner-title\">Extremely thin, crispy, light and fluffy.</h2>\r\n	<div class=\"container\">\r\n		<div class=\"row\">\r\n			<div class=\"col-sm-4\">\r\n				<span class=\"big-icon\"><i class=\"restaurant-icon-18\"></i></span>\r\n				<p class=\"banner-desc\">Perfect pizzas made the Italian way.</p>\r\n			</div>\r\n			<div class=\"col-sm-4\">\r\n				<span class=\"big-icon\"><i class=\"restaurant-icon-28\"></i></span>\r\n				<p class=\"banner-desc\">The best choice for a warm family dinner.</p>\r\n			</div>\r\n			<div class=\"col-sm-4\">\r\n				<span class=\"big-icon\"><i class=\"restaurant-icon-30\"></i></span>\r\n				<p class=\"banner-desc\">Free fresh-squeezed juices with every order.</p>\r\n			</div>\r\n		</div>\r\n	</div>\r\n</div>','2017-01-16 10:15:39','2017-01-27 14:49:17',1),(12,'Testimonials','testimonials-block','<div class=\"testimonials-block footer-col\">\r\n	<h4 class=\"testimonial-title\">Testimonials</h4>\r\n	<div class=\"footer-col-content\">\r\n		<p class=\"testimonial-comment\">I was very impressed at the excellent service. So tasty and yummy pizza and at a reasonable price. Thanks! <br /> Highly recommend.</p>\r\n		<p class=\"testimonial-name\">- Taylor Miller</p>\r\n	</div>\r\n</div>','2017-01-16 15:48:07','2017-01-27 12:45:35',1),(13,'header-add-info','header-add-info','<div class=\"header-add-info\"><a href=\"#\">1 800 597 47 59</a></div>','2017-01-26 08:08:39','2017-01-26 08:08:39',1);
