INSERT INTO `cms_page` VALUES (1,'404 Not Found','2columns-left','Page keywords','Page description','no-route','Whoops, our bad...','<div class=\"not-found-page\">\r\n	<dl>\r\n		<dt class=\"heading-4 primary-color\">The page you requested was not found, and we have a fine guess why.</dt>\r\n		<dd>\r\n			<ul class=\"disc\">\r\n				<li>If you typed the URL directly, please make sure the spelling is correct.</li>\r\n				<li>If you clicked on a link to get here, the link is outdated.</li>\r\n			</ul>\r\n		</dd>\r\n	</dl>\r\n	<dl>\r\n		<dt class=\"heading-4 primary-color\">What can you do?</dt>\r\n		<dd class=\"heading-5\">Have no fear, help is near! There are many ways you can get back on track with Magento Store.</dd>\r\n		<dd>\r\n			<ul class=\"disc\">\r\n				<li><a onclick=\"history.go(-1); return false;\" href=\"#\">Go back</a> to the previous page.</li>\r\n				<li>Use the search bar at the top of the page to search for your products.</li>\r\n				<li>Follow these links to get you back on track!<br /><a href=\"{{store url=\"\"}}\">Store Home</a> <span class=\"separator\">|</span> <a href=\"{{store url=\"customer/account\"}}\">My Account</a></li>\r\n			</ul>\r\n		</dd>\r\n	</dl>\r\n</div>\r\n','2016-03-12 16:24:45','2016-06-24 16:55:41',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2,'Saturino - Home page','1column','','','home','','<p style=\"display:none\">CMS homepage content goes here.</p>\r\n','2016-03-12 16:24:45','2017-01-16 09:05:48',1,0,'<!--\r\n    <referenceContainer name=\"right\">\r\n        <action method=\"unsetChild\"><argument name=\"alias\" xsi:type=\"string\">right.reports.product.viewed</argument></action>\r\n        <action method=\"unsetChild\"><argument name=\"alias\" xsi:type=\"string\">right.reports.product.compared</argument></action>\r\n    </referenceContainer>-->',NULL,NULL,NULL,NULL,NULL,''),(3,'Enable Cookies','1column',NULL,NULL,'enable-cookies','What are Cookies?','<div class=\"enable-cookies cms-content\">\r\n<p>\"Cookies\" are little pieces of data we send when you visit our store. Cookies help us get to know you better and personalize your experience. Plus they help protect you and other shoppers from fraud.</p>\r\n<p style=\"margin-bottom: 20px;\">Set your browser to accept cookies so you can buy items, save items, and receive customized recommendations. Here’s how:</p>\r\n<ul>\r\n<li><a href=\"https://support.google.com/accounts/answer/61416?hl=en\" target=\"_blank\">Google Chrome</a></li>\r\n<li><a href=\"http://windows.microsoft.com/en-us/internet-explorer/delete-manage-cookies\" target=\"_blank\">Internet Explorer</a></li>\r\n<li><a href=\"http://support.apple.com/kb/PH19214\" target=\"_blank\">Safari</a></li>\r\n<li><a href=\"https://support.mozilla.org/en-US/kb/enable-and-disable-cookies-website-preferences\" target=\"_blank\">Mozilla/Firefox</a></li>\r\n</ul>\r\n</div>','2016-03-12 16:24:45','2016-03-12 16:24:45',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(4,'Privacy Policy','1column','','','privacy-policy-cookie-restriction-mode','Privacy Policy','<div class=\"change-message\">\r\n    <span>Please replace this text with your Privacy Policy.</span>\r\n</div>\r\n<dl class=\"custom-page\">\r\n    <dt class=\"heading-2\">General information</dt>\r\n    <dd>Welcome to our Privacy Policy page! When you use our store services, you trust us with your information. This Privacy Policy is meant to help you understand what data we collect, why we collect it, and what we do with it. When you share information with us, we can make our services even better for you. For instance, we can show you more relevant search results and ads, help you connect with people or to make sharing with others quicker and easier. As you use our services, we want you to be clear how we’re using information and the ways in which you can protect your privacy. This is important; we hope you will take time to read it carefully. Remember, you can find controls to manage your information and protect your privacy and security. We’ve tried to keep it as simple as possible.</dd>\r\n    <dt class=\"heading-2\">Right to access, correct and delete data and to object to data processing</dt>\r\n    <dd>Our customers have the right to access, correct and delete personal data relating to them, and to object to the processing of such data, by addressing a written request, at any time. The Company makes every effort to put in place suitable precautions to safeguard the security and privacy of personal data, and to prevent it from being altered, corrupted, destroyed or accessed by unauthorized third parties. However, the Company does not control each and every risk related to the use of the Internet, and therefore warns the Site users of the potential risks involved in the functioning and use of the Internet. The Site may include links to other web sites or other internet sources. As the Company cannot control these web sites and external sources, the Company cannot be held responsible for the provision or display of these web sites and external sources, and may not be held liable for the content, advertising, products, services or any other material available on or from these web sites or external sources.</dd>\r\n    <dt class=\"heading-2\">Management of personal data</dt>\r\n    <dd>You can view or edit your personal data online for many of our services. You can also make choices about our collection and use of your data. How you can access or control your personal data will depend on which services you use. You can choose whether you wish to receive promotional communications from our store by email, SMS, physical mail, and telephone. If you receive promotional email or SMS messages from us and would like to opt out, you can do so by following the directions in that message. You can also make choices about the receipt of promotional email, telephone calls, and postal mail by visiting and signing into Company Promotional Communications Manager, which allows you to update contact information, manage contact preferences, opt out of email subscriptions, and choose whether to share your contact information with our partners. These choices do not apply to mandatory service communications that are part of certain store services.</dd>\r\n    <dt class=\"heading-2\">Information We Collect</dt>\r\n    <dd>Our store collects data to operate effectively and provide you the best experiences with our services. You provide some of this data directly, such as when you create a personal account. We get some of it by recording how you interact with our services by, for example, using technologies like cookies, and receiving error reports or usage data from software running on your device. We also obtain data from third parties (including other companies). For example, we supplement the data we collect by purchasing demographic data from other companies. We also use services from other companies to help us determine a location based on your IP address in order to customize certain services to your location. The data we collect depends on the services and features you use.</dd>\r\n    <dt class=\"heading-2\">How We Use Your Information</dt>\r\n    <dd>Our store uses the data we collect for three basic purposes: to operate our business and provide (including improving and personalizing) the services we offer, to send communications, including promotional communications, and to display advertising. In carrying out these purposes, we combine data we collect through the various store services you use to give you a more seamless, consistent and personalized experience. However, to enhance privacy, we have built in technological and procedural safeguards designed to prevent certain data combinations. For example, we store data we collect from you when you are unauthenticated (not signed in) separately from any account information that directly identifies you, such as your name, email address or phone number.</dd>\r\n    <dt class=\"heading-2\">Sharing Your Information</dt>\r\n    <dd>We share your personal data with your consent or as necessary to complete any transaction or provide any service you have requested or authorized. For example, we share your content with third parties when you tell us to do so. When you provide payment data to make a purchase, we will share payment data with banks and other entities that process payment transactions or provide other financial services, and for fraud prevention and credit risk reduction. In addition, we share personal data among our controlled affiliates and subsidiaries. We also share personal data with vendors or agents working on our behalf for the purposes described in this statement. For example, companies we\'ve hired to provide customer service support or assist in protecting and securing our systems and services may need access to personal data in order to provide those functions. In such cases, these companies must abide by our data privacy and security requirements and are not allowed to use personal data they receive from us for any other purpose. We may also disclose personal data as part of a corporate transaction such as a merger or sale of assets.</dd>\r\n</dl>','2016-03-12 16:24:45','2016-10-17 18:33:42',1,0,'',NULL,NULL,NULL,NULL,NULL,''),(6,'Customer Service','1column','','','customer-service','Customer Service','<div class=\"custom-page\">\r\n    <div>\r\n        <span class=\"primary-color heading-3\">Hello and welcome to the Shipping and Delivery Information page! Here you can get acquainted with useful information on terms and conditions of our goods delivery. </span>\r\n        <p>You can purchase your items online and pick them up at our street store, or ship them directly to your doorstep. Shipping is free on some orders. We use the best carriers in the business to make sure your order gets to you on time. From the Secure Checkout page you\'ll see your item description, price and delivery timing. Where available, you can also choose a faster delivery method for each item on your order, for an additional fee. Delivery times vary according to your selected delivery address, availability of your items and the time of day you place your order.</p>\r\n    </div>\r\n \r\n    <div class=\"section-title\">\r\n        <h2>Cost</h2>\r\n    </div>\r\n    <table class=\"table-bordered data-table responsive\">\r\n        <thead>\r\n            <tr>\r\n                <th>Service</th>\r\n                <th>Locations</th>\r\n                <th>Delivery Schedule</th>\r\n                <th>Cost per Shipment</th>\r\n            </tr>\r\n        </thead>\r\n        <tbody>\r\n            <tr>\r\n                <td><span class=\"primary-color\">Royal mail 1st Class Service (Order value $20 or less)</span></td>\r\n                <td>All of UK &amp; some European Countries </td>\r\n                <td>1-3 days <br> Monday - Saturday</td>\r\n                <td><span class=\"price\">$3.95</span></td>\r\n            </tr>\r\n            <tr>\r\n                <td><span class=\"primary-color\">Royal mail Tracker (Order value $50 or less)</span></td>\r\n                <td>All of UK</td>\r\n                <td>1-3 days <br> Monday - Saturday</td>\r\n                <td><span class=\"price\">$4.95</span></td>\r\n            </tr>\r\n            <tr>\r\n                <td><span class=\"primary-color\">Standard Courier Delivery</span></td>\r\n                <td>UK mainland only</td>\r\n                <td>1-3 days <br> Delivery 7.30am - 5.30am <br> Monday - Friday</td>\r\n                <td><span class=\"price\">$5.95</span></td>\r\n            </tr>\r\n            <tr>\r\n                <td><span class=\"primary-color\">Standard Courier Delivery</span></td>\r\n                <td>Northern Ireland, Eire, Scilly Isles</td>\r\n                <td>1-3 days <br> Delivery 7.30am - 5.30am <br> Monday - Friday</td>\r\n                <td><span class=\"price\">$9.95</span></td>\r\n            </tr>\r\n            <tr>\r\n                <td><span class=\"primary-color\">Royal mail 1st Class Service (Order value $20 or less)</span></td>\r\n                <td>All of UK &amp; some European Countries </td>\r\n                <td>1-3 days <br> Monday - Saturday</td>\r\n                <td><span class=\"price\">$3.95</span></td>\r\n            </tr>\r\n            <tr>\r\n                <td><span class=\"primary-color\">Priority courier pre 12pm Next Working Day</span></td>\r\n                <td>UK mainland only</td>\r\n                <td>Pre 12pm <br> Delivery 7.30am - 12pm <br> Monday - Friday</td>\r\n                <td><span class=\"price\">$8.95</span></td>\r\n            </tr>\r\n            <tr>\r\n                <td><span class=\"primary-color\">Royal mail 1st Class Service (Order value $20 or less)</span></td>\r\n                <td>All of UK &amp; some European Countries </td>\r\n                <td>1-3 days <br> Monday - Saturday</td>\r\n                <td><span class=\"price\">$3.95</span></td>\r\n            </tr>\r\n        </tbody>\r\n    </table>\r\n \r\n    <div class=\"section-title\">\r\n        <h2>Free Delivery</h2>\r\n    </div>\r\n    <p class=\"a-center indent1\">Free two-day shipping is available on in-stock items. You can see in your bag if your item is in stock. Free two-day shipping is not available on customized, engraved products, and for certain order types, including orders paid for with financing or by bank transfer. To get free two-day shipping, you will need to place your order by 5pm, Monday to Friday. For instance, if you order your goods before 5:00 pm, Monday to Friday we will deliver them in two business days.</p>\r\n \r\n    <div class=\"section-title\">\r\n        <h2>Terms &amp; Conditions</h2>\r\n    </div>\r\n    <div class=\"row terms-conditions text-left\">\r\n        <div class=\"col-sm-6\">\r\n            <h4 class=\"material-icons-check_circle small-icon primary-color\">Entire agreement</h4>\r\n            <p>If you require a complete delivery of your orders, please enter an X in the Complete Delivery field on the shipping screen of the customer master record. The indicator is copied into the order header, which you can also use for the purpose.</p>\r\n            <h4 class=\"material-icons-check_circle small-icon primary-color\">Controlling terms</h4>\r\n            <p>Buyer expressly agrees that Seller’s Invoice and these Terms and Conditions of Sale represent the complete agreement of the parties with respect to the sale of the product(s) listed on the Invoice and no different or additional terms or conditions in Buyer’s purchase order or in any other prior or subsequent communications in any way adding to, modifying or otherwise changing these Terms and Conditions of Sale shall be binding upon Seller. </p>\r\n            <h4 class=\"material-icons-check_circle small-icon primary-color\">acceptance of orders</h4>\r\n            <p>Seller may accept buyer’s offer to purchase and shall be bound to supply the applicable Goods in accordance with these terms and conditions either by execution of the acknowledgment copy of the order, or acceptable electronic transmission, delivery of the Goods to CAI or by any other statement, act or course of conduct which constitutes acceptance under applicable law.</p>\r\n            <h4 class=\"material-icons-check_circle small-icon primary-color\">prices</h4>\r\n            <p>Unless otherwise indicated on the face of the invoice, all prices are quoted on a per pound basis. Buyer is responsible for any tax or government charges imposed upon the sale or transfer of the Product. Buyer shall not have any right to set off any amounts due hereunder against any amounts which may become payable to Seller under any other agreement.</p>\r\n            <h4 class=\"material-icons-check_circle small-icon primary-color\">delivery</h4>\r\n            <p>Unless otherwise agrees in writing signed by officer of Seller, all delivery dates are estimates Seller shall use its reasonable efforts to deliver all Product within the time specified; however, in no case shall Seller be liable for any expense, loss or damage whatsoever suffered by Buyer as a result of the Seller’s failure to deliver Product by the specified date.</p>\r\n            <h4 class=\"material-icons-check_circle small-icon primary-color\">transportation and risk of loss</h4>\r\n            <p>The method and route of shipment are at Seller’s discretion unless Buyer timely supplies explicit instructions otherwise. Title to the Product passes to Buyer when Product is delivered to the selected carrier, even if Seller made a nonconforming tender. Buyer attempts to revoke acceptance of the Product, or Buyer repudiates this document after the Products have been identified hereto.</p>\r\n            <h4 class=\"material-icons-check_circle small-icon primary-color\">cancellation or modification</h4>\r\n            <p>Any order placed with and accepted by Seller may be canceled by Buyer only upon Seller’s approval in a writing signed by an officer of Seller and upon terms that indemnify Seller against any loss. Seller will not accept order cancellations once a product has been delivered to a carrier, without charging a cancellation fee of twenty-five percent (25%) of order value to recover retrieval costs incurred. Seller will not accept cancellations of special orders of non-standard, non-price list products. Seller may cancel all or any part of this order and discontinue its performance hereunder without liability to Buyer in the event Buyer materially breaches this contract, becomes insolvent, is the subject to bankruptcy protection, or is the subject of a receivership, liquidation, dissolution or similar proceeding.</p>\r\n        </div>\r\n        <div class=\"col-sm-6\">\r\n            <h4 class=\"material-icons-check_circle small-icon primary-color\">warranty and disclaimer</h4>\r\n            <p>Seller warrants that the purchased Product is free from defects in materials and workmanship at the time of delivery. If an analysis is stated on the face of the Invoice, it is not intended to be a complete analysis and is not to be regarded as a specification or warranty, unless specifically stated in writing to be such. </p>\r\n            <h4 class=\"material-icons-check_circle small-icon primary-color\">limitation of liability</h4>\r\n            <p>Buyer acknowledges and agrees that seller’s liability for any claims with respect to the products shall not exceed the amount paid by buyer for the products under the invoice. Such limitations on seller’s liability hereunder shall apply even if seller’s liability is due in whole or in part to its own negligence. Any action by or on behalf of Buyer or its successors or assigns for breach of this document must be commenced within one (1) year after the cause of action as accrued.</p>\r\n            <h4 class=\"material-icons-check_circle small-icon primary-color\">return of material</h4>\r\n            <p>Upon delivery of Product, Buyer shall have five (5) days to inspect Product and notify Seller, in writing, of any defective goods or other cause for rejection. Buyer agrees that five (5) day period provides Buyer a reasonable opportunity to inspect the Product. Such notification shall identify each and every reason for any rejection of Product. Buyer’s failure to reject Product within such five (5) day period shall constitute a waiver of Buyer’s inspection right and an unqualified and irrevocable acceptance of the Product by Buyer.</p>\r\n            <h4 class=\"material-icons-check_circle small-icon primary-color\">indemnity</h4>\r\n            <p>Buyer shall defend, indemnify and hold harmless Seller and its affiliated or related companies from and against any and all claims, losses, liability, damages and expenses including, but not limited to, attorneys’ fees and cost of defense arising from, related to or in any way connected with or alleged to arise from or out of any asserted deficiencies or defects in Product caused by any alteration or modification thereof by Buyer with or without Seller’s consent, or improper handling or storage by Buyer, the breach of any term or condition stated herein, Buyer’s failure to label Product or Buyer’s improper labeling of Product regardless of whether the labeling was done with or without the advice of Seller.</p>\r\n            <h4 class=\"material-icons-check_circle small-icon primary-color\">payment</h4>\r\n            <p>Net cash thirty (30) days from the date of Invoice. Amounts not paid within thirty (30) days are overdue and shall accrue interest at a rate of one and one-half percent (1-1/2%) per month or the highest allowed by law, whichever is less. Buyer shall reimburse Seller for any costs incurred in collecting past due sums or any other amounts owed by Buyer for any reason whatsoever, including, but not limited to, court costs and attorneys’ fees.</p>\r\n            <h4 class=\"material-icons-check_circle small-icon primary-color\">governing law and arbitration</h4>\r\n            <p>This document shall be interpreted and governed by the law of the State of America, excluding its conflicts of laws rules. The parties specifically exclude the application of the United Nations Convention on the Sale of Goods.</p>\r\n            <h4 class=\"material-icons-check_circle small-icon primary-color\">taxes</h4>\r\n            <p>Buyer is responsible for any tax or governmental charge imposed upon the sale or transfer of any product. Any such tax or governmental charge will be added to the total invoice amount. All prices are FOB Seller’s facilities. Applicable freight costs will be added to the invoice.</p>\r\n        </div>\r\n    </div>\r\n</div>\r\n\r\n<script>\r\nvar headertext = [];\r\nvar headers = document.querySelectorAll(\"table.data-table thead\");\r\nvar tablebody = document.querySelectorAll(\"table.data-table tbody\");\r\n\r\nfor (var i = 0; i < headers.length; i++) {\r\n    headertext[i]=[];\r\n    for (var j = 0, headrow; headrow = headers[i].rows[0].cells[j]; j++) {\r\n      var current = headrow;\r\n      headertext[i].push(current.textContent);\r\n      }\r\n} \r\n\r\nfor (var h = 0, tbody; tbody = tablebody[h]; h++) {\r\n    for (var i = 0, row; row = tbody.rows[i]; i++) {\r\n      for (var j = 0, col; col = row.cells[j]; j++) {\r\n        col.setAttribute(\"data-th\", headertext[h][j]);\r\n      } \r\n    }\r\n}\r\n</script>','2016-03-12 17:22:30','2016-10-17 18:34:02',1,0,'',NULL,NULL,NULL,NULL,NULL,''),(7,'About Us','1column','','','about-us','About Us','<div class=\"custom-page text-center\">\r\n    <div>\r\n        <span class=\"heading-3\">Catering to your requirements, handling your needs with care</span>\r\n        <p>Our store is more than just another average online retailer. We sell not only top quality products, but give our customers a positive online shopping experience. Forget about struggling to do everything at once: taking care of the family, running your business, walking your dog, cleaning the house, doing the shopping, etc. Purchase the goods you need every day or just like in a few clicks or taps, depending on the device you use to access the Internet. We work to make your life more enjoyable.</p>\r\n    </div>\r\n    <div class=\"skills row\">\r\n        <div class=\"col-xs-12 col-sm-4\">\r\n            <div class=\"value\"><span class=\"number\" data-finish=\"14500\">0</span></div>\r\n            <div class=\"term\">Products available</div>\r\n        </div>\r\n        <div class=\"col-xs-12 col-sm-4\">\r\n            <div class=\"value\"><span class=\"number\" data-finish=\"81\">0</span>%</div>\r\n            <div class=\"term\">Clients come back</div>\r\n        </div>\r\n        <div class=\"col-xs-12 col-sm-4\">\r\n            <div class=\"value\"><span class=\"number\" data-finish=\"10\">0</span> mlns</div>\r\n            <div class=\"term\">Site members</div>\r\n        </div>\r\n    </div>\r\n \r\n    <div class=\"section-title\">\r\n        <h2>Store events</h2>\r\n    </div>\r\n    <div class=\"row\">\r\n        <div class=\"col-xs-12 col-sm-4\">\r\n            <div class=\"material-icons-search big-circle-icon\"></div>\r\n            <h4 class=\"primary-color\">For convenience of choice</h4>\r\n            We think about the convenience of your choice. Our products are supplied with star rating that should help hesitant buyers to take a decision. What’s more, you can search our site if you know exactly what you are looking for or use a bunch of different filters that will considerably save your time and efforts.\r\n        </div>\r\n        <div class=\"col-xs-12 col-sm-4\">\r\n            <div class=\"material-icons-directions_car big-circle-icon\"></div>\r\n            <h4 class=\"primary-color\">Delivery to all regions</h4>\r\n            We deliver our goods worldwide. No matter where you live, your order will be shipped in time and delivered right to your door or to any other location you have stated. The packages are handled with utmost care, so the ordered products will be handed to you safe and sound, just like you expect them to be.\r\n        </div>\r\n        <div class=\"col-xs-12 col-sm-4\">\r\n            <div class=\"material-icons-thumb_up big-circle-icon\"></div>\r\n            <h4 class=\"primary-color\">The highest quality of products</h4>\r\n            We guarantee the highest quality of the products we sell. Several decades of successful operation and millions of happy customers let us feel certain about that. Besides, all items we sell pass thorough quality control, so no characteristics mismatch can escape the eye of our professionals.\r\n        </div>\r\n    </div>\r\n \r\n    <div class=\"section-title\">\r\n        <h2>Our team</h2>\r\n    </div>\r\n    <div class=\"team row\">\r\n        <div class=\"col-xs-12 col-sm-3\">\r\n            <figure><a href=\"#\" title=\"Robert Johnson\"><img src=\"{{view url=\'images/media/team1.jpg\'}}\" alt=\"Robert Johnson\"></a></figure>\r\n            <span class=\"he