e is quite reasonable. Told all my friends about your excellent service and the variety of choice. I think I’ll be your loyal customer in future as well. I wish your store many more years of prosperity.</q>\r\n        </blockquote>\r\n        <blockquote class=\"item\">\r\n            <cite>JESSICA PRISTON</cite>\r\n            <q>Having the distressing experience with some online shops before decided to say ‘’THANK YOU” to all personnel of this store. You are not only friendly, but deliver really good products in the shortest possible terms. In a word, I am absolutely happy with my purchase and the service. Everything was perfect!</q>\r\n        </blockquote>\r\n        <blockquote>\r\n            <cite>SAM KROMSTAIN</cite>\r\n            <q>Guys, you rock! Made a purchase at your store recently. The order has been shipped and delivered on time. The quality is superb! The price is quite reasonable. Told all my friends about your excellent service and the variety of choice. I think I’ll be your loyal customer in future as well. I wish your store many more years of prosperity.</q>\r\n        </blockquote>\r\n        <blockquote>\r\n            <cite>Edna Barton</cite>\r\n            <q>Having the distressing experience with some online shops before decided to say ‘’THANK YOU” to all personnel of this store. You are not only friendly, but deliver really good products in the shortest possible terms. In a word, I am absolutely happy with my purchase and the service. Everything was perfect!</q>\r\n        </blockquote>\r\n    </div>\r\n</div>','2016-03-12 17:25:42','2016-10-17 18:34:18',1,0,'',NULL,NULL,NULL,NULL,NULL,''),(8,'Template settings','1column',NULL,NULL,'template-settings','Template Settings','<h3><em>1. Home pages configurationn</em></h3>\r\n<table class=\"data-table data-table-indent\">\r\n    <thead>\r\n    <tr>\r\n            <th>#</th>\r\n            <th>Page Name</th>                  \r\n            <th>Page HTML (Content tab)</th>\r\n            <th>Pa