ent 2</td>\r\n            <td>footer_col_2</td>\r\n            <td>sources\\demo\\blocks\\footer_col_2.phtml</td>\r\n        </tr>\r\n        <tr>\r\n            <td>3.</td>\r\n            <td>Footer column content 3</td>\r\n            <td>Footer column content 3</td>\r\n            <td>footer_col_3</td>\r\n            <td>sources\\demo\\blocks\\footer_col_3.phtml</td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n \r\n \r\n<h3><em>3. Widgets configuration</em></h3>\r\n \r\n<table class=\"data-table data-table-indent\">\r\n    <thead>\r\n        <tr>\r\n            <th>#</th>\r\n            <th>Widget Name</th>\r\n            <th>Widget type</th>\r\n            <th>Content</th>            \r\n        </tr>\r\n    </thead>\r\n    <tbody>\r\n        <tr>\r\n            <td>1.</td>\r\n            <td>Widget 1</td>\r\n            <td>Block</td>\r\n            <td>Block 1</td>\r\n        </tr>\r\n    </tbody>\r\n</table>','2016-03-12 17:26:35','2016-03-12 17:26:35',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(9,'Shipping & Delivery','empty','','','shipping-delivery','Shipping & Delivery','<div class=\"shipping-delivery-page\">\r\n    <p>\r\n        So you’ve done your shopping; just how long will it be till you can rock that swanky new Axolotl-themed laptop skin? The calculator below will give you the average amount of days it takes to ship a product to your door and the best time to contact our support team. Please note that every order at Redbubble is custom printed just for you, and will take 1-3 business days to print prior to shipping.\r\n    </p>\r\n    <span class=\"heading-3\">Here are a few things to consider while you wait for your order:</span>\r\n    <ul>\r\n        <li><span>We ship in business days. Monday - Friday, excluding national holidays.</span></li>\r\n        <li><span>Shipping starts from the date you received the “Your Order Has Shipped!” email.</span></li>\r\n        <li><span>The estimate above does not include manufacturing time - we need 1-3 business days to make sure your custom order is everything you hoped it would be.</span></li>\r\n    </ul>\r\n    <p>\r\n        Redbubble is a global company - we work with production and shipping partners all over the world to get your things to your doorstep, wherever that may be. Although the vast majority of our customers will get their orders by the day listed above, actual timeframes may vary from region to region.\r\n    </p>\r\n    <div class=\"shipping-delivery-page__border\">\r\n        <span class=\"heading-3\">So when do you contact Redbubble?</span>\r\n        <span>The calculator above lets you know the best time to message us. When that day rolls around.</span>\r\n        <span>Even if your order hasn’t arrived by the listed date, it’s probably still on its way (and worth the wait).</span>\r\n    </div>\r\n    <ol class=\"shipping-delivery-page__list\">\r\n        <li>\r\n            <span class=\"heading-3 shipping-delivery-page_shipping-icon\">How much is shipping?</span>\r\n            <p>Once you’ve clicked through to Secure Checkout, you can enter your delivery address and choose a shipping method. Shipping costs are then calculated and tacked on to your subtotal at the bottom of the page.</p>\r\n        </li>\r\n        <li>\r\n            <span class=\"heading-3 shipping-delivery-page_track-icon\">Can I track my order?</span>\r\n            <p>We rely on a global network of shipping partners (UPS, FedEx, DHL) as well as local postal services (USPS) to get your order to your doorstep as soon as possible. For this reason, tracking is not always available. If your order is being sent by a trackable service, these details will be included on your orders page as well as on the shipping email we send you.</p>\r\n        </li>\r\n        <li>\r\n            <span class=\"heading-3 shipping-delivery-page_order-icon\">Where does my order ship from?</span>\r\n            <p>We rely on a global network of shipping partners (UPS, FedEx, DHL) as well as local postal services (USPS) to get your order to your doorstep as soon as possible. For this reason, tracking is not always available. If your order is being sent by a trackable service, these details will be included on your orders page as well as on the shipping email we send you.</p>\r\n        </li>\r\n    </ol>\r\n</div>','2016-10-17 18:35:24','2016-10-17 18:35:24',1,0,'',NULL,NULL,NULL,NULL,NULL,''),(10,'FAQ','empty','','','faq','FAQ','\r\n<div class=\"faq-page\">\r\n    <div id=\"faq-accordion\">\r\n        <div class=\"accordion-block close\">\r\n            <div class=\"accordion-trigger close\">\r\n                <span>Lorem ipsum dolor sit amet conse ctetur adipisicing elit?</span>\r\n            </div>\r\n            <div class=\"accordion-content\"><p>Lorem ipsum dolor sit amet conse ctetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore. Lorem ipsum dolor sit amet conse ctetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore.</p> </div>                \r\n        </div>\r\n        <div class=\"accordion-block close\">\r\n            <div class=\"accordion-trigger close\">\r\n                <span>Lorem ipsum dolor sit amet conse ctetur adipisicing elit?</span>\r\n            </div>\r\n            <div class=\"accordion-content\"><p>Lorem ipsum dolor sit amet conse ctetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit es