INSERT INTO `tm_blog_comment` VALUES ('1','2',1,'Eva','anny.sunny17@gmail.com','Follow your dream and it will turn to reality. A very inspiring article. Thanks for sharing!','2016-06-25 04:40:33','2016-06-25 04:40:33'),('2','1',1,'Joy','anny.sunny17@gmail.com','\"The success of your business would solely depend on you. The only thing you can rely on is your power to achieve your goal\" – very true to life statement.','2016-06-25 04:41:05','2016-06-25 04:41:05'),('3','4',1,'Bob','beba@gmail.com','The author did a great job with all these research work. Really valuable information, thank you!','2016-06-25 04:42:23','2016-06-25 04:42:23'),('4','4',1,'Ben','beba@gmail.com','That’s awesome! Future belongs to youngsters, so businessmen can’t ignore their needs in any case.','2016-06-25 04:43:03','2016-06-25 04:43:03');
